import Link from "next/link";
import { useEffect } from "react";
export default function Index() {
  useEffect(() => {
    fetch("api/test")
      .then(response => response.text())
      .then(text => console.log(text))
      .catch(err => {
        if (err) throw err;
      });
  });

  return (
    <>
      <h1>Test</h1>
      <Link href="/about">
        <a>Go to About!</a>
      </Link>
    </>
  );
}
